import React from "react";
import { FaAngleRight } from "react-icons/fa";
import { Link } from "react-router-dom";

function Audits({ homeAudits }) {
  return (
    <div>
      {homeAudits.map((audit, index) => {
        const { tenantid, tenantName, timeRemaining, status, date } = audit;
        return (
          <div className="hometenants-grid">
            <div className="hometenant-grid">
              <div>{tenantName}</div>
              {audit.status === "resolved" ? (
                <div>resolved</div>
              ) : (
                <div>unresolved</div>
              )}
              <Link
                className="btn-homeToTenant"
                to={`/institution/${tenantid}`}
              >
                <FaAngleRight />
              </Link>
            </div>
          </div>
        );
      })}
    </div>
  );
}

export default Audits;
